import {Route} from 'react-router-dom'
import AllMeetUpsPage from "./pages/AllMeetUps";
import NewMeetUpsPage from "./pages/NewMeetIp";
import FavoriteMeetUpsPage from "./pages/Favorites";

function App() {
  return <div>
      <Route path='/'>
        <AllMeetUpsPage />
      </Route>
      <Route path='/favorite'>
        <FavoriteMeetUpsPage />
      </Route>
      <Route path='/new'>
        <NewMeetUpsPage />
      </Route>
  </div>;
}

export default App;
